import { Component } from '@angular/core';
import { AuthService } from '../../servicos/auth.service';
import { Router } from '@angular/router';
import { UsuarioService } from '../../servicos/usuario.service';
import { Usuario } from '../../modelos/usuario';
import { v4 as uuidv4 } from 'uuid';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
  login: string = '';
  senha: string = '';
  validacao: string = '';
  validacaoFixa: string = '000000';
  loginSucesso: boolean = false;
  loginFalha: boolean = false;
  novoUsuarioCadastrado: boolean = false;

  novoUsuario: Usuario = {
    id: uuidv4(),
    login: '',
    senha: ''
  };

  constructor(
    private authService: AuthService,
    private router: Router,
    private usuarioService: UsuarioService
  ) { }

  onSubmit () {
    this.authService.login(this.login, this.senha).subscribe(
      (response) => {
        this.handleLoginSuccess(response.token);
      },
      (error) => {
        this.handleLoginError(error);
      }
    );
  }

  private handleLoginSuccess (token: string): void {
    this.loginSucesso = true;
    this.loginFalha = false;
    this.novoUsuarioCadastrado = false;

    this.authService.setTokenAndScheduleLogout(token);
    this.router.navigate(['/']);
  }

  private handleLoginError (error: any): void {
    if (this.validacao === this.validacaoFixa) {
      this.createUsuarioAndLogin();
    } else {
      this.loginSucesso = false;
      this.loginFalha = true;
      this.novoUsuarioCadastrado = false;
    }
  }

  private createUsuarioAndLogin (): void {
    this.usuarioService.salvarUsuario(this.novoUsuario).subscribe(
      () => {
        this.loginSucesso = false;
        this.loginFalha = false;
        this.novoUsuarioCadastrado = true;
        // Pode adicionar lógica adicional, como fazer login automaticamente após o cadastro.
      },
      (error) => {
        console.error('Erro ao criar usuário:', error);
        // Adicione tratamento de erro adequado aqui.
      }
    );
  }
}
<div>
  <div *ngIf="loginSucesso" class="alert alert-success" role="alert">
    Login bem-sucedido!
  </div>

  <div *ngIf="loginFalha" class="alert alert-danger" role="alert">
    Falha no login! Verifique suas credenciais.
  </div>

  <div *ngIf="novoUsuarioCadastrado" class="alert alert-info" role="alert">
    Novo usuário cadastrado com sucesso!
  </div>
</div>

<div class="container">
  <div class="row justify-content-center">
    <div class="col-md-6">
      <div class="card">
        <div class="card-header">Acesso</div>
        <div class="card-body">
          <form (submit)="onSubmit()" #loginForm="ngForm">
            <div class="mb-3">
              <label for="login" class="form-label">Login</label>
              <input type="text" id="login" class="form-control" placeholder="Digite seu usuário" [(ngModel)]="login"
                name="login" required>
            </div>
            <div class="mb-3">
              <label for="senha" class="form-label">Senha</label>
              <input type="password" id="senha" class="form-control" placeholder="Digite sua senha" [(ngModel)]="senha"
                name="senha" required>
            </div>
            <div class="mb-3">
              <label for="validacao" class="form-label">Validação</label>
              <input type="text" id="validacao" class="form-control"
                placeholder="Digite os 6 dígitos enviados por email" [(ngModel)]="validacao" name="validacao">
              <div class="form-text">Não implementado, para novos cadastros, utilize "000000"</div>
            </div>
            <button type="submit" class="btn btn-primary" [disabled]="!loginForm.valid">Login</button>
          </form>
        </div>
      </div>
    </div>
  </div>
</div>
